import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { UserGroupIcon, TrophyIcon, PlusCircleIcon } from '@heroicons/react/24/outline';

const cardVariants = {
  hidden: { opacity: 0, y: 30 },
  visible: (i) => ({ opacity: 1, y: 0, transition: { delay: i * 0.15 } }),
};

const OrganizerDashboard = () => {
  const [hackathons] = useState([
    {
      id: 1,
      title: 'AI Innovation Challenge 2024',
      date: '2024-04-15',
      participants: 25,
      judges: 5,
      status: 'Active',
    },
    {
      id: 2,
      title: 'Web3 Development Hackathon',
      date: '2024-05-01',
      participants: 15,
      judges: 3,
      status: 'Upcoming',
    },
  ]);

  return (
    <div className="space-y-8">
      <div className="flex justify-between items-center">
        <div>
          <h1 className="text-2xl font-bold text-yellow-900 mb-1">Welcome, Organizer! 🛠️</h1>
          <p className="text-yellow-700">Manage hackathons, participants, and judges with ease!</p>
        </div>
        <motion.button
          whileHover={{ scale: 1.08 }}
          whileTap={{ scale: 0.96 }}
          className="flex items-center px-4 py-2 bg-gradient-to-r from-yellow-400 to-yellow-600 text-white rounded-lg shadow-lg font-semibold"
        >
          <PlusCircleIcon className="h-5 w-5 mr-2 animate-pulse" />
          Create Hackathon
        </motion.button>
      </div>
      <motion.div className="grid grid-cols-1 md:grid-cols-3 gap-6" initial="hidden" animate="visible">
        <motion.div
          variants={cardVariants}
          custom={0}
          className="glassmorphism bg-gradient-to-br from-yellow-100/80 to-yellow-200/80 rounded-xl shadow-xl p-6 flex flex-col items-center"
        >
          <TrophyIcon className="h-10 w-10 text-yellow-600 mb-2 animate-bounce" />
          <h2 className="font-semibold text-yellow-900 mb-2">Manage Hackathons</h2>
          <p className="text-yellow-800 text-sm text-center mb-2">Create, edit, and monitor all ongoing and upcoming hackathons.</p>
          <ul className="w-full mt-2 space-y-2">
            <AnimatePresence>
              {hackathons.map((h, i) => (
                <motion.li
                  key={h.id}
                  initial={{ opacity: 0, x: -20 }}
                  animate={{ opacity: 1, x: 0 }}
                  exit={{ opacity: 0, x: 20 }}
                  transition={{ delay: i * 0.1 }}
                  className="flex justify-between items-center bg-white/80 rounded-lg px-3 py-2 shadow"
                >
                  <span className="font-medium text-yellow-900">{h.title}</span>
                  <span className="text-xs text-yellow-700">{h.status}</span>
                </motion.li>
              ))}
            </AnimatePresence>
          </ul>
        </motion.div>
        <motion.div
          variants={cardVariants}
          custom={1}
          className="glassmorphism bg-gradient-to-br from-yellow-100/80 to-yellow-200/80 rounded-xl shadow-xl p-6 flex flex-col items-center"
        >
          <UserGroupIcon className="h-10 w-10 text-yellow-600 mb-2 animate-pulse" />
          <h2 className="font-semibold text-yellow-900 mb-2">Participants</h2>
          <p className="text-yellow-800 text-sm text-center mb-2">View and manage all registered participants for your events.</p>
          <span className="text-2xl font-bold text-yellow-700">40+</span>
        </motion.div>
        <motion.div
          variants={cardVariants}
          custom={2}
          className="glassmorphism bg-gradient-to-br from-yellow-100/80 to-yellow-200/80 rounded-xl shadow-xl p-6 flex flex-col items-center"
        >
          <UserGroupIcon className="h-10 w-10 text-yellow-600 mb-2 animate-bounce" />
          <h2 className="font-semibold text-yellow-900 mb-2">Judges</h2>
          <p className="text-yellow-800 text-sm text-center mb-2">Assign, invite, and manage judges for your hackathons.</p>
          <span className="text-2xl font-bold text-yellow-700">8</span>
        </motion.div>
      </motion.div>
    </div>
  );
};

export default OrganizerDashboard;
